css:
@-moz-document url-prefix("http://www.dev-c.com/nativedb/") {
#mw {
    background: #222;
    border: none;
    color: #848484;
}

body {
    background: #2b2b2b;
}

.tabz li {
    background: transparent;
    font-size: 1em;
}

.tabz li a {
    color: #c0c0c0;
    text-decoration: underline;
}

.tabz input {
    background: transparent;
    border: none;
    margin: 7px;
    color: #c0c0c0;
    text-decoration: underline;
    font-size: 1.15em;
}

a:link, a:visited {
    color: #c0c0c0;
}

.fndecl {
    color: #b3b3b3 !important;
}

.fntype {
    color: #4582d9;
}

.fnparam {
    color: #848484;
}

.fncomm {
    color: #21cc59a1;
}

.funcinfo {
    background: #2b2b2b;
    color: #999;
}
}
